static constexpr int kModulo = 1'000'000'007;

//#define DEBUG
//#define PROFILE


namespace ProfilerDetails
{
    inline auto now()
    {
        clock_t val = clock();
        return val;
    }
};

class Profiler
{

public:

    Profiler(std::string name) :
        m_start(ProfilerDetails::now()),
        m_name(std::move(name))
    {
        std::cout << "Profiler: \"" + m_name + "\" started!\n";
    }

    ~Profiler()
    {
        long double val = (ProfilerDetails::now() - m_start) / (CLOCKS_PER_SEC / 1'000'000);

        enum UNIT : unsigned                  { US,   MS,   S };
        const char * unit_names[] =           {"us", "ms", "s"};

        UNIT current_unit = US;
        while (val >= 1000.0 && current_unit != S)
        {
            val /= 1000.0;
            current_unit = (UNIT)((unsigned)current_unit + 1);
        }

        std::ostringstream oss;
        oss << std::setprecision(3) << val;
        std::cout << "Profiler: \"" + m_name + "\" finished in " + oss.str() + unit_names[(unsigned)current_unit] + "\n";
    }

private:
    decltype(ProfilerDetails::now()) m_start;
    std::string m_name;
};


class ModuloOfPowerOfTwoCache
{
public:
    ModuloOfPowerOfTwoCache()
    {
        m_remainders_by_exp.push_back( 1 % kModulo );
    }

    int compute_or_get_remainder(int exp)
    {
        grow_if_necessary(exp);
        return m_remainders_by_exp[exp];
    }

private:

    void grow_if_necessary(int exp)
    {
        int old_size = static_cast<int>(m_remainders_by_exp.size());

        if (exp >= old_size)
        {
            #ifdef PROFILE
                Profiler p("ModuloOfPowerOfTwoCache::grow_if_necessary");
            #endif

            m_remainders_by_exp.resize(exp + 1);

            for (int i = old_size; i < static_cast<int>(m_remainders_by_exp.size()); ++i)
            {
                m_remainders_by_exp[i] = m_remainders_by_exp[i - 1] * 2 % kModulo;
            }
        }
    }

    std::vector<int> m_remainders_by_exp;
};

static ModuloOfPowerOfTwoCache s_modulo_of_power_of_two_cache;


class Solution {
public:
    int sumSubseqWidths(std::vector<int> A)
    {
        Profiler p("sumSubseqWidths");

        std::sort(A.begin(), A.end());

        long sum_of_widths = 0;

        // Improved. No need to compute the difference for every pair. Scan through array once only.
        const int length = static_cast<int>(A.size());
        for (int i = 0; i < length; ++i)
        {
            int val = A[i];

            long minus_count = s_modulo_of_power_of_two_cache.compute_or_get_remainder(length - i - 1) - 1;
            long plus_count = s_modulo_of_power_of_two_cache.compute_or_get_remainder(i - 0) - 1;

            long elem = (val * plus_count) - (val * minus_count);

            sum_of_widths = (sum_of_widths + elem) % static_cast<long>(kModulo);
        }

        return sum_of_widths;
    }
};

